import React, { Component } from 'react';

import shoe2 from '../images/shoe2.png'


class BannerSub extends Component {

	render(){
		return(
	     	<div style={{padding:'32px'}}>
	     		<img style={{width:'100%'}} src={shoe2}/>
	     	</div>
		);
	}
}


export default BannerSub;
